script: |
  super -f text -I q8889.spq | sort > q8889.out

inputs:
  - name: q8889.spq
    data: |
      SELECT DISTINCT col0 + - 80 FROM tab2 (FORMAT parquet) WHERE NOT - col2 * + - 1 + - ( - col1 ) - col1 * col1 IS NULL;
  - name: tab2

outputs:
  - name: q8889.out
    data: |
      -16
      -34
      -5
